{"cells":[{"source":"<a href=\"https://www.kaggle.com/code/quzeem91/google-data-analytics-capstone-project-case-study1?scriptVersionId=102892257\" target=\"_blank\"><img align=\"left\" alt=\"Kaggle\" title=\"Open in Kaggle\" src=\"https://kaggle.com/static/images/open-in-kaggle.svg\"></a>","metadata":{},"cell_type":"markdown","outputs":[],"execution_count":0},{"cell_type":"code","execution_count":null,"id":"b7aea3b0","metadata":{"papermill":{"duration":0.017318,"end_time":"2022-08-09T13:02:27.622834","exception":false,"start_time":"2022-08-09T13:02:27.605516","status":"completed"},"tags":[]},"outputs":[],"source":[]},{"cell_type":"markdown","id":"680f0389","metadata":{"papermill":{"duration":0.013217,"end_time":"2022-08-09T13:02:27.650018","exception":false,"start_time":"2022-08-09T13:02:27.636801","status":"completed"},"tags":[]},"source":["# Cyclistic Bike-Share Analysis \n","\n","## Introduction\n","I am a  junior data analyst working in the marketing analyst team at **Cyclistic**, a bike-share company in **Chicago**. The director of marketing believes the company’s future success depends on maximizing the number of annual memberships. Therefore, your team wants to understand how casual riders and annual members use Cyclistic bikes differently. From these insights, your team will design a new marketing strategy to convert casual riders into annual members. But first, Cyclistic executives must approve your recommendations, so they must be backed up with compelling data insights and professional data visualizations.\n","    In this Analysis  we will follow the Phases of the data analysis process: ask, prepare, process, analyze, share, and act.\n","\n","\n","**About The Datasets**\n","The Datasets consists of 5,723,532 observations(rows) and  \n","18 variables(columns).\n","\n","**The Variables**\n","\n","* ride_id : Each ride has a unique Id containing of both numbers and alphabets\n","* rideable_type: The different bike types that can be  used for each ride,\n","                 which are;Classic , Electric  and Docked Type .\n","* started_at: The time a ride started .\n","* ended_at : The time a ride ended .\n","* member_casual: consist of two categorical variables(member and casual) which                   are the membership type Cyclistic offers  \n","* ride_length: The length of a ride in minutes.\n","* Hour : The hour of the day  a ride starts. \n","* Day : Days of the week \n","* n_days: Day of the week in number.\n","* Month : months of  the year in which rides occur \n","* start_station_name: Name of station where a ride starts.  \n","* start_station_id: Id of station where a ride ends.\n","* end_station_name : Name of station where a ride ends. \n","* end_station_id: Id of station where a ride ends\n","* start_lat: the latitude when a ride was started.\n","* start_lng : the longitude when a ride ends. \n","* end_lat:  latitude of where a ride ends.\n","* end_lng:  longitude of where a ride ends\n","\n","    \n","# Phase 1- Ask:\n","\n","**Buisness Tasks** :\n","Design marketing strategies aimed at converting casual riders into annual members. \n","\n","**Stakeholders**\n","\n","●Lily Moreno: The director of marketing and your manager. Moreno is responsible for the development of campaigns and initiatives to promote the bike-share program. These may include email, social media, and other channels.\n","\n","●Cyclistic marketing analytics team: A team of data analysts who are responsible for collecting, analyzing, and reporting data that helps guide Cyclistic marketing strategy.\n","\n","●Cyclistic executive team: The notoriously detail-oriented executive team will decide whether to approve the recommended marketing program.\n","\n","# Phase 2 - Prepare :\n","In this phase,The 12 Datasets were downloaded and loaded into the R environment. The data for this analysis was gotten from this  \n","[link](https://divvy-tripdata.s3.amazonaws.com/index.html)\n","The data was  made available by Motivate International Inc. under this \n","[license](https://ride.divvybikes.com/data-license-agreement)\n","\n","# Phase 3 - Process:\n","we will  be using R programming Language for our Analysis  \n","\n","**Installing Required Packages** \n"," \n","we wil be using the pacman package for this analysis  \n"]},{"cell_type":"code","execution_count":1,"id":"62165d51","metadata":{"execution":{"iopub.execute_input":"2022-08-09T13:02:27.680256Z","iopub.status.busy":"2022-08-09T13:02:27.678184Z","iopub.status.idle":"2022-08-09T13:02:27.837306Z","shell.execute_reply":"2022-08-09T13:02:27.835522Z"},"papermill":{"duration":0.177247,"end_time":"2022-08-09T13:02:27.840463","exception":false,"start_time":"2022-08-09T13:02:27.663216","status":"completed"},"tags":[]},"outputs":[],"source":["\n","#install.packages(\"pacman\",)\n","\n","library(pacman)\n","\n","\n"]},{"cell_type":"markdown","id":"78b3014d","metadata":{"papermill":{"duration":0.013293,"end_time":"2022-08-09T13:02:27.867097","exception":false,"start_time":"2022-08-09T13:02:27.853804","status":"completed"},"tags":[]},"source":["**Loading other package by pacman p_load**"]},{"cell_type":"code","execution_count":2,"id":"104592d3","metadata":{"execution":{"iopub.execute_input":"2022-08-09T13:02:27.925491Z","iopub.status.busy":"2022-08-09T13:02:27.895587Z","iopub.status.idle":"2022-08-09T13:02:29.099197Z","shell.execute_reply":"2022-08-09T13:02:29.097558Z"},"papermill":{"duration":1.22178,"end_time":"2022-08-09T13:02:29.102283","exception":false,"start_time":"2022-08-09T13:02:27.880503","status":"completed"},"tags":[]},"outputs":[],"source":["\n","pacman:: p_load(pacman,dplyr,tidyverse,lubridate,ggplot2,tibble)\n","\n"]},{"cell_type":"markdown","id":"119bd8cd","metadata":{"papermill":{"duration":0.013448,"end_time":"2022-08-09T13:02:29.12922","exception":false,"start_time":"2022-08-09T13:02:29.115772","status":"completed"},"tags":[]},"source":[]},{"cell_type":"markdown","id":"5ab26b93","metadata":{"papermill":{"duration":0.013659,"end_time":"2022-08-09T1