uration":0.022878,"end_time":"2022-08-09T13:07:32.647828","exception":false,"start_time":"2022-08-09T13:07:32.62495","status":"completed"},"tags":[]},"source":["**Jan - Feb** <br>\n"," there are less rides during this period, might be as a result of the cold       weather in Chicago during this period \n"," \n","**Mar-Apr:** <br>\n","Rides increased to 260k as a result of the weather being less cold \n","\n","**May-oct:** <br>\n","Rides increased to 460k in may and climaxed at 800k in June and decreased to 600k in Oct\n","\n","**Nov-Dec:** <br>\n","Rides decreased to 390k from NOv then to 220k in Dec as a result of the cold weather resuming .\n","\n","**Conclusion** <br>\n","There's a correlation between the season and the amount of rides(i.e\n","the weather affects the number of rides ).\n","Cold weather correlates with less amount of  rides , while warm weather correlates with large amount of rides .\n","\n","\n","\n","**Further  Analysis and Visualization  By Grouping and Aggregation** \n"]},{"cell_type":"code","execution_count":35,"id":"9c7a643e","metadata":{"execution":{"iopub.execute_input":"2022-08-09T13:07:32.696385Z","iopub.status.busy":"2022-08-09T13:07:32.694825Z","iopub.status.idle":"2022-08-09T13:07:45.644731Z","shell.execute_reply":"2022-08-09T13:07:45.643003Z"},"papermill":{"duration":12.976697,"end_time":"2022-08-09T13:07:45.647231","exception":false,"start_time":"2022-08-09T13:07:32.670534","status":"completed"},"tags":[]},"outputs":[{"name":"stderr","output_type":"stream","text":["\u001b[1m\u001b[22m`summarise()` has grouped output by 'Day'. You can override using the `.groups`\n","argument.\n"]}],"source":["\n","p3 <- aggregate(ride_length ~member_casual +Day ,df_main,mean ,sort=TRUE)\n","p5 <- aggregate(ride_length ~ member_casual,df_main,mean )\n","\n","\n","p1 <-df_main %>% group_by(Day,member_casual) %>%\n","          summarize(avg_ride_length=mean(ride_length))\n","\n"]},{"cell_type":"markdown","id":"cda86400","metadata":{"papermill":{"durati