 Hosting  Events/Competitions were public figures and celebrities will be invited \n","   and Annual members will be  the only ones eligible to attend and participate.\n","  The Events/ competitions can be hosted monthly,Quarterly ,or at the end of the    year. \n","\n","2. The Marketing team should partner with an insurance company where  accidents \n","   on bikes and riders will be taken care of by Cyclistic if they are Annual       Members.This incentive should attract more casual members to switch to Annual    Membership subscription .\n","   \n","\n","3. The Marketing team Should increase the Price of Purchase of \n","   single rides and Full day passes  while the Price of Purchase for  Annual       Membership should remain the same and also giving the Annual Members  room      for installment payments .\n"]}],"metadata":{"kernelspec":{"display_name":"R","language":"R","name":"ir"},"language_info":{"codemirror_mode":"r","file_extension":".r","mimetype":"text/x-r-source","name":"R","pygments_lexer":"r","version":"4.0.5"},"papermill":{"default_parameters":{},"duration":322.480126,"end_time":"2022-08-09T13:07:46.620892","environment_variables":{},"exception":null,"input_path":"__notebook__.ipynb","output_path":"__notebook__.ipynb","parameters":{},"start_time":"2022-08-09T13:02:24.140766","version":"2.3.4"}},"nbformat":4,"nbformat_minor":5}